  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <a href="/">amazo</a>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<HomeScreen />}></Route>
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
